resources.string:
1. Semakin aktif anggota keluarga di platform, semakin tinggi peringkat keluarga. Login harian, bertahan di kamar, dan pemberian hadiah bisa meningkatkan nilai aktif.
2. Aturan perhitungan nilai aktif anggota keluarga:
①Setiap anggota login bisa mendapat 20 nilai aktif tiap hari;
②Setiap anggota bertahan di kamar mana pun selama 10 menit bisa mendapat 50 nilai aktif setiap hari;
③Konsumsi berlian dan koin emas, 1 berlian = 1 nilai aktif, 10 koin emas= 1 nilai aktif.
3. Peringkat mingguan dan bulanan hanya menghitung total nilai aktif keluarga selama periode event, peringkat mingguan diperbarui tiap minggu, dan peringkat bulanan diperbarui setiap bulan.
